  \"2016-05-31T07:58:13.564637\",\n\t\"name\": \"noaa-climate-data-record-cdr-of-ocean-heat-fluxes-version-1-0\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The NOAA Ocean Surface Bundle (OSB) Climate
  Data Record (CDR) consist of three parts: sea surface temperature, near-surface
  atmospheric properties, and heat fluxes. This portion of the OSB CDR is the NOAA
  Climate Data Record (CDR) of Ocean Heat Fluxes. The OSB CDR parameters of near-surface
  atmospheric and sea surface temperature are used to calculate the latent and sensible
  heat fluxes from a neural-network emulator of the TOGA-COARE Bulk Air-Sea Flux Algorithm.
  The data cover a time period from January 1988 - December 2007 at a 3-hourly, quarter-degree
  resolution.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
